  render() {
    return (
      <div className="main">
        <h1> آلة حاسبة </h1>
         <div>
         <nav>
          <button>آلة حاسبة</button>
          <button>آلة حاسبة علمية</button>
         </nav>
        <ScientificCalculator />
        <Calculator />
         </div>
      </div>
    );
  }
}

export default App;
